// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import Table from "examples/Tables/Table";
import tableData from "layouts/pages/users/reports/data/tableData";

function Opportunity() {
    const { columns, rows } = tableData;

    const Columns =
    {
        columns: [
            { InvestorName: "name", align: "left" },
            { PanNo: "function", align: "left" },
            { Scheme: "review", align: "left" },
            { FolioNo: "email", align: "center" },
            { FreeUnits: "employed", align: "center" },
            { CurrentAmount: "id", align: "center" },
            { InvestedAmount: "ids", align: "center" },
        ],

        rows: [
            {
                name: [team2, "ABHA AGARWAL"],
                function: "AEGPA6692G",
                review: "L&T TAX ADVANTAGE FUND - GROWTH",
                email: "4224834/03",
                employed: "1362.249",
                id: "	1,07,044",
                ids: "75,000",
            },
            {
                name: [team2, "ABHA AGARWAL"],
                function: "AEGPA6692G",
                review: "L&T TAX ADVANTAGE FUND - GROWTH",
                email: "4224834/03",
                employed: "1362.249",
                id: "	1,07,044",
                ids: "75,000",
            },
        ],
    }


    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiBox my={3}>

                <SuiBox mb={3}>
                    <Grid container spacing={3} alignItems="center">
                        <Grid item xs={12} lg={6}>
                            <SuiTypography variant="h4" fontWeight="medium">
                                ELSS Lock-in free Report
                            </SuiTypography>
                            <SuiBox mt={1} mb={2}>
                                <SuiTypography variant="body2" textColor="text">
                                    * This report shows the units invested in ELSS funds which are free from Lock-in period of 3 years, for each user and can now be switched into other suitable fund choices.
                                </SuiTypography>
                            </SuiBox>
                        </Grid>
                    </Grid>
                </SuiBox>
            </SuiBox>

            <SuiBox my={3}>
                <Card>
                    <DataTable table={Columns} entriesPerPage={false} />
                </Card>
            </SuiBox>
            <Footer />
        </DashboardLayout>
    );
}

export default Opportunity;
